!async function(){let e=await fetch('https://foobar-4ea8.restdb.io/rest/receipt?q={"name": "Simone"}',{method:"get",headers:{"Content-Type":"application/json; charset=utf-8","x-apikey":"60b6304c318a330b62f58925","cache-control":"no-cache"}});(await e.json()).forEach((e=>{const t=document.querySelector(".receipt_template").content.cloneNode(!0);t.querySelector(".receipt_order_number").textContent=e.orderId,t.querySelector(".receipt_subtotal").textContent=e.subTotal,document.querySelector(".receipt_container").appendChild(t)}))}();
